import React from 'react'
import ExpenseItem from './ExpenseItem';
import "./ExpenseList.css"

const ExpenseList = ({items}) => {

    if (items.length === 0) {
        return <p>No expense found.</p>;
    }

    return (
        items.map((item) => {
            return (
                <ExpenseItem
                    key={item.id}
                    title={item.title}
                    amount={item.amount}
                    date={item.date} />
            )
        })
    )
    


}

export default ExpenseList
